    public void CountRecord()
    {
        var temp = this.Grid.GetSelectedRecords();
        RecordCount = temp.Result.Count;
        temp.GetAwaiter().OnCompleted(() =>
        {
            this.Temp = temp.Result; // here you I get the selected row datas in form list of objects.
